import React from 'react';
import BrandDisplayer from '../component/BrandDisplayer';

export default function producto() {
	return (
		<div className='producto-tipo'>
			<BrandDisplayer />
			<style jsx>
				{`
					:global(body) {
						background: #f3f3f3;
						margin: 0;
						position: relative;
						font-family: 'Montserrat', sans-serif;
					}
				`}
			</style>
		</div>
	);
}
